def get_sentence_score(no,low,high):
    # score the essay on a scale of 1 to 5 based on the number of sentences
    score = 0
    if no > low and no <= 10:
        score = 1
    elif no > 10 and no <= high:
        r = (high-10)/3
        if no > 10 and no<=(10+r):
            score = 2
        elif no >(10+r) and no<=(10+2*r):
            score = 3
        elif no >(10+2*r) and no<=(10+3*r):
            score = 4

    elif no > high:
        score = 5
    return score

def getSentences(filename):
    with open (filename, "r") as myfile:
        sentences=myfile.read()
    # sentences = cleanText(sentences)
    tokenizer._params.abbrev_types.add('dr')
    tokenizer._params.abbrev_types.add('mr')
    tokenizer._params.abbrev_types.add('phd')
    # print (tokenizer.tokenize(sentences))
    final_sentences = []
    sent = tokenizer.tokenize(sentences)
    no_of_sentences = 0
    try:
        for text in sent:
            tree = ParentedTree.fromstring(str(nlp.parse(text)))
            # print(tree)
            no_of_sentences+=1
            final_sentences.append((" ").join(tree.leaves()))
            for subtree in tree.subtrees():
                if subtree.label()=="SBAR":
                    child = tree[subtree.treeposition()+(0,)]
                    if child.label()=="S":
                        if child.leaves()[0][0].isupper():
                            comp = (" ").join(child.leaves())
                            last = len(final_sentences)-1
                            if  last >= 0:
                                final_sentences[last] = final_sentences[last].replace(comp,"").strip()
                            final_sentences.append(comp)
                            no_of_sentences+=1
    except:
        final_sentences = sent
        no_of_sentences = len(sent)
    print(no_of_sentences)
    return no_of_sentences,final_sentences


def trainGrammar():
    #  this trains the grammar to calculate bigram probabilities of POS tags from a corpus
    # writes the calculated probabilities to a file and returns a hash with those probabilities
    f = open("../input/training/index.csv", "r")
    line_no = 1
    tags = []
    pref = "../input/training/essays/"
    f1= open(pref+"/probabilities.py","w+")
