    tokenizer._params.abbrev_types.add('phd')
    final_sentences = []
    sentences = nltk.corpus.gutenberg.sents('austen-emma.txt')


    for s in sentences:
        sent = (" ").join(s)
        pos_tags = nlp.pos_tag(sent)
        tags += list(map(lambda g: g[1], pos_tags))
    print(tags)
    tag_bigrm = nltk.bigrams(tags)
    tb = list(tag_bigrm)
    tag_freq = {}
    trans_prob = {}
    for t in tags:
        tag_freq[t] = tags.count(t)
    for t1 in set(tags):
        for t2 in set(tags):
            count = tb.count((t1,t2))
            if count > 0:
                trans_prob[t2+"|"+t1] = {"count": count, "prob": count/tag_freq[t1]}
    f1.write("trans_prob="+str(trans_prob))
    return trans_prob
