def grammarScore(sentences, trans_prob):
    # uses the POS bigram probabilities
    total_prob = 0
    # calculate joint probability for each sentence, if the probability is 0 or below a certain threshold
    # increase the error count.
    for sent in sentences:
        pos_tags = nlp.pos_tag(sent)
        twords = list(map(lambda g: g[1], pos_tags))
        sent_prob = 1
        for i in range(len(twords)-1):
            try:
                tagi = twords[i+1]
                tagi_minus_one = twords[i]
                tag_prob = trans_prob[tagi+"|"+tagi_minus_one]['prob']
                if round(tag_prob*1000)==0:
                    tag_prob = 0
            except:
                tag_prob = 0
            sent_prob *=tag_prob
        if sent_prob == 0:
            total_prob+=1


    return (((len(sentences)-total_prob)/len(sentences))*5)

def agreementCheck(sentences):
    cnt = 0
    for sentence in sentences:
        tokens = word_tokenize(sentence)
        parse = nlp.dependency_parse(sentence)
        nsubj = []
        for dep, i, j in parse:
            if 'nsubj' in dep:
                nsubj.append((i,j))
        tagged_tokens = pos_tag(tokens)
    # checking for noun-verb agreement based on POS tags and nsubj dependency
    # For eg: occurrence of NNS with VBZ, does not agree in count.
        for i,j in nsubj:
            if (tagged_tokens[i-1][1] == 'NN' or tagged_tokens[i-1][1] == 'NNS' or tagged_tokens[i-1][1] == 'NNP' or tagged_tokens[i-1][1] == 'NNPS') and (tagged_tokens[j-1][1] == 'VBP' or tagged_tokens[j-1][1] == 'VBZ'):
                if ((tagged_tokens[i-1][1] == 'NN' or tagged_tokens[i-1][1] == 'NNP') and (tagged_tokens[j-1][1] == 'VBP')) or ((tagged_tokens[i-1][1] == 'NNS' or tagged_tokens[i-1][1] == 'NNPS') and (tagged_tokens[j-1][1] == 'VBZ')):
                    cnt += 1
            elif (tagged_tokens[j-1][1] == 'NN' or tagged_tokens[j-1][1] == 'NNS' or tagged_tokens[j-1][1] == 'NNP' or tagged_tokens[j-1][1] == 'NNPS') and (tagged_tokens[i-1][1] == 'VBP' or tagged_tokens[i-1][1] == 'VBZ'):
                if ((tagged_tokens[j-1][1] == 'NN' or tagged_tokens[j-1][1] == 'NNP') and (tagged_tokens[i-1][1] == 'VBP')) or ((tagged_tokens[j-1][1] == 'NNS' or tagged_tokens[j-1][1] == 'NNPS') and (tagged_tokens[i-1][1] == 'VBZ')):
                    cnt += 1
    return (5-min(5,cnt))
def pronounResolution(sentences):
    error = 0
    toBeEliminated = ['i', 'me', 'my', 'myself', 'mine', 'you', 'your', 'yours', 'yourself', 'we', 'it', 'us', 'our', 'ours', 'ourself', 'ourselves']
    prev = sentences[0]
    for curr in sentences[1:]:
        tokenizer = RegexpTokenizer('[A-Za-z0-9\']+')
        pos = pos_tag(tokenizer.tokenize(curr))
        toBeEvaluated = []
        for tag in pos:
            if tag[1]=='PRP' or tag[1]=='PRP$':
                if tag[0].lower() not in toBeEliminated:
                    toBeEvaluated.append(tag[0])
        clusters = coref.one_shot_coref(utterances=curr, context=prev)
        repr = coref.get_most_representative()
        for i in toBeEvaluated:
            flag = True
            for key in repr.keys():
                if i == str(key):
                    # print(i)
                    flag = False
                    break
            if flag:
                error += 1
        prev = curr
    return 5 - min(error, 5)
def getGrammarScore(sentences):
    err=0
    total_err =0
    for sent in sentences:
        err=0
        prep_count = 0
        pos_tags = nlp.pos_tag(sent)
        dep = nlp.dependency_parse(sent)
        words = nlp.word_tokenize(sent)
        npresent = True
        # print(dep)
        for tags in pos_tags:
            # prepositions need to have an object
            if tags[1] == "IN":
                prep_count+=1
        if pos_tags[-1][1] == 'PRP$':
            # sentence cannot end with possesive pronoun
            err+=1
        for ele in dep:
            if ele[0] == "aux":
                # past participle rule
                if nlp.pos_tag(words[int(ele[2])-1])[0][1] == 'VBD' and nlp.pos_tag(words[int(ele[1])-1])[0][1] !="VBN":

                    err+=1
            if ele[0] == 'nsubj':
                # every complete sentence needs to have a subject
                npresent = False

            if ele[0] == 'case' or 'mark':
                prep_count-=1

        if npresent:
            err+=1
        if prep_count > 0:
            err+=1

        str_tree = str(nlp.parse(sent))
        tree = ParentedTree.fromstring(str_tree)
        i =0
        for subtree in tree.subtrees():
            if i==1:
                if subtree.label() not in ['S','SINV']:
                    # checks if there are fragments in the parse tree, or there is no main clause etc
                    err+=1
            i+=1
        if err > 0:
            total_err+=1
    return (((len(sentences)-total_err)/len(sentences))*5)
